FullErrList = np.array([])
FullxiList = np.array([])
FulltList = np.array([])

def convert_space_list(s):
    """Convert '1 2 3 nan 4.5' into numpy array [1, 2, 3, nan, 4.5]."""
    result = []
    for x in s.strip().split():
        if x.lower() == "nan":
            result.append(np.nan)
        else:
            result.append(float(x))
    return np.array(result)

def synthesislist(xlist, meanlist, errlist, xival, tval):
    global Fullxlist, FullMeanList, FullErrList, FullxiList, FulltList
    
    xnum = convert_space_list(xlist)
    meannum = convert_space_list(meanlist)
    errnum = convert_space_list(errlist)
    xinum = xival * np.ones_like(xnum)
    tnum = tval * np.ones_like(xnum)
    
    Fullxlist = np.concatenate([Fullxlist, xnum])
    FullMeanList = np.concatenate([FullMeanList, meannum])
    FullErrList = np.concatenate([FullErrList, errnum])
    FullxiList = np.concatenate([FullxiList, xinum])
    FulltList = np.concatenate([FulltList, tnum])

